import { createContext } from "react";

const AppContext = createContext();
const AppProvider = ({ children }) => {
  const testData = {
    name: "prajeet",
    age: "2",
  }
  const makadox = {
    name: "dox",
    age: 5,
  };

  return (
    <AppContext.Provider value={{ testData, makadox }}>
      {children}
    </AppContext.Provider>
  );
};

export { AppContext, AppProvider };
